import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
  menu: {
    backgroundColor: 'var(--bg-color-accent)',
  },

  menuItem: {
    color: 'var(--text-color)',
    fontSize: '1.6rem',
  },
}));
